// -------------------------
// INICIALIZAR MAPA
// -------------------------

// -------------------------
// FUNCIÓN PARA NORMALIZAR TELÉFONO
// -------------------------
function normalizarTelefono(fono) {
  if (!fono) return ""; // evita errores

  // eliminar todo lo que no sea número
  let limpio = fono.replace(/\D+/g, "");

  // si NO parte con 56 → agregarlo
  if (!limpio.startsWith("56")) {
    limpio = "56" + limpio;
  }

  // devolver formato universal de llamada
  return `tel:+${limpio}`;
}

// -------------------------
// CONFIGURAR MAPA
// -------------------------
const centroLat = servicios.length ? servicios[0].lat : -33.45;
const centroLng = servicios.length ? servicios[0].lng : -70.66;

const map = L.map("map").setView([centroLat, centroLng], 13);

// Fondo de mapa (OpenStreetMap)
L.tileLayer("https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png", {
  maxZoom: 19,
  attribution: "&copy; OpenStreetMap contributors",
}).addTo(map);

// -------------------------
// UBICACIÓN DEL USUARIO (AUTO-CENTRAR)
// -------------------------
map.locate({
  setView: true,
  maxZoom: 16
});

map.on("locationfound", (e) => {
  L.circleMarker(e.latlng, {
    radius: 8,
    color: "#007bff",
    fillColor: "#3f8cff",
    fillOpacity: 0.9
  }).addTo(map).bindPopup("📍 Estás aquí");
});

map.on("locationerror", (e) => {
  console.log("No se pudo obtener ubicación:", e.message);
});

// -------------------------
// ESCALAR POPUP SEGÚN ZOOM (SOLO MÓVIL)
// -------------------------
const isMobile = window.innerWidth <= 768;
const baseZoom = map.getZoom();   // ej: 13
const baseFont = 16;              // tamaño base en px

function actualizarTamañoPopups() {
  if (!isMobile) return; // en desktop no hace nada

  const z = map.getZoom();

  // si subes de 13 a 17 → factor ~ 2
  const factor = Math.pow(1.25, (z - baseZoom)); 

  const popupContents = document.querySelectorAll(".leaflet-popup-content");

  popupContents.forEach((el) => {
    el.style.fontSize = (baseFont * factor) + "px";
    el.style.lineHeight = "1.3";
  });
}

if (isMobile) {
  map.on("zoomend", actualizarTamañoPopups);
  actualizarTamañoPopups(); // aplica una vez al inicio
}

// -------------------------
// PINTAR MARCADORES
// -------------------------
servicios.forEach((servicio) => {
  if (typeof servicio.lat !== "number" || typeof servicio.lng !== "number") {
    return; // si falta lat/lng, saltamos este servicio
  }

  const marker = L.marker([servicio.lat, servicio.lng]).addTo(map);

  // Teléfono limpio para llamar
  const fonoLink = normalizarTelefono(servicio.telefono);

  // URL de "Cómo llegar" en Google Maps
  const mapsUrl = `https://www.google.com/maps/dir/?api=1&destination=${servicio.lat},${servicio.lng}`;

  // Contenido del popup
  const popupHtml = `
    <div style="font-size:15px;">
      <strong style="font-size:16px;">${servicio.nombre}</strong><br/>

      <b>Teléfono:</b>
      ${servicio.telefono 
        ? `<a href="${fonoLink}" style="color:#1a73e8; font-size:15px;">${servicio.telefono}</a>` 
        : "No registrado"}
      <br/>

      <b>Tipo:</b> ${servicio.tipo || "Sin tipo"}<br/>

      <a href="${mapsUrl}" target="_blank" style="color:#1a73e8; font-size:15px;">
        📍 Cómo llegar
      </a>
      <br/>

      <span style="font-size:11px; color:#666;">
        PlaceID: ${servicio.placeId || "N/A"}
      </span>
    </div>
  `;

  marker.bindPopup(popupHtml);
});
